--#创建奖品定义表
CREATE TABLE IF NOT EXISTS `b_prize` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `name` varchar(255) DEFAULT NULL COMMENT '奖品名称',
  `description` varchar(255) DEFAULT NULL COMMENT '详细描述',
  `num` bigint(20) DEFAULT NULL COMMENT '奖品数量',
  `price` decimal(10,0) DEFAULT NULL,
  `type` bigint(10) DEFAULT NULL COMMENT '奖品类型：1为第三方券；2为实物; 3为眯客券',
  `url` varchar(255) DEFAULT NULL COMMENT '跳转地址',
  `weight` bigint(20) DEFAULT NULL COMMENT '权重',
  `merchantid` bigint(20) DEFAULT NULL COMMENT '商户id',
  `activeid` bigint(20) DEFAULT NULL COMMENT '活动id',
  `enable` char(50) DEFAULT NULL COMMENT '是否启用',
  `begintime` datetime DEFAULT NULL COMMENT '开始时间',
  `endtime` datetime DEFAULT NULL COMMENT '结束时间',
  PRIMARY KEY (`id`),
  KEY `idx_activeid` (`activeid`)
) ENGINE=InnoDB AUTO_INCREMENT=10 DEFAULT CHARSET=utf8;

