--#创建奖品库存表
CREATE TABLE IF NOT EXISTS `b_prize_stock` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `prizeid` bigint(20) NOT NULL COMMENT '奖品编码',
  `code` varchar(255) NOT NULL COMMENT '优惠码',
  `name` varchar(255) NOT NULL COMMENT '优惠券名称',
  `begintime` datetime DEFAULT NULL COMMENT '券有效期开始时间',
  `endtime` datetime DEFAULT NULL COMMENT '券有效期结束时间',
  `status` char(50) NOT NULL COMMENT '是否被抽中',
  `merchantid` bigint(20) NOT NULL COMMENT '商户编码',
  `activeid` bigint(20) NOT NULL COMMENT '活动编码',
  PRIMARY KEY (`id`),
  UNIQUE KEY `idx_merchantid_code` (`merchantid`,`code`)
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 comment '奖品库存表';

--#创建用户抽奖记录表
CREATE TABLE IF NOT EXISTS `u_prize_record` (
  `id` bigint(20) NOT NULL AUTO_INCREMENT,
  `mid` bigint(20) NOT NULL COMMENT '会员编码',
  `prizeid` bigint(20) NOT NULL COMMENT '奖口编码',
  `prizeinfo` varchar(255) DEFAULT NULL COMMENT '奖品信息（优惠券码）',
  `ostype` bigint(20) NOT NULL COMMENT '用户抽奖设备',
  `activeid` bigint(20) NOT NULL COMMENT '活动编码',
  `createtime` datetime NOT NULL COMMENT '抽奖时间',
  `prizetype` bigint(20) DEFAULT NULL COMMENT '奖品类型：1为第三方券；2为眯客券; 3为实物',
  PRIMARY KEY (`id`),
  KEY `idx_mid` (`mid`) USING BTREE,
  KEY `idx_activeid` (`activeid`) USING BTREE,
  KEY `idx_createtime` (`createtime`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=1 DEFAULT CHARSET=utf8 comment '用户抽奖记录表';

ALTER TABLE `ots`.`b_activity`   
  ADD COLUMN `activeurl` VARCHAR(255) NULL AFTER `promotionmethodtype`,
  ADD COLUMN `activepic` VARCHAR(255) NULL AFTER `activeurl`;

